import * as React from 'react';
import {  BrowserRouter as Router,  Switch,  Route,  Link} from "react-router-dom";
import Button from "@material-ui/core/Button";
import { makeStyles } from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import RestoreIcon from '@material-ui/icons/Restore';
import FavoriteIcon from '@material-ui/icons/Favorite';
import LocationOnIcon from '@material-ui/icons/LocationOn';


import Home from "../views/Home";
import Excursiones from "../views/Excursiones";
import Cursos from "../views/Cursos";
import Lugares from "../views/Lugares";
import Galeria from "../views/Galeria";
import imagenes from "../assets/imagenes";

/*{<Link to="/">
<Button variant="contained" color="primary" >
Home
</Button>
</Link>}*/
const useStyles = makeStyles({
  root: {
    width: 500,
  },
});

function Routers() {
    const classes = useStyles();
    const [value, setValue] = React.useState(0);

    return (
      <Router>                
        <div>             
              <Link to="/">
                <img src={imagenes.img2} width="180" height="110" spacing={8}/>
              </Link>                                                  
              
              <Link to="/">
                <Button variant="contained" color="primary" >
                Home
                </Button>
              </Link>
            
              <Link to="/excursiones">
                <Button variant="contained" color="primary" aria-label="add" spacing={2}>
                Excursiones
                </Button>
              </Link>
           
              <Link to="/cursos">
                <Button variant="contained" color="primary">
                Cursos
                </Button>
              </Link>
            
              <Link to="/lugares">
                <Button variant="contained" color="primary">
                Lugares
                </Button>
              </Link>
            
              <Link to="/galeria">
                <Button variant="contained" color="primary">
                Galeria
                </Button>
              </Link>      
                      
           
          <Switch>
          <Route path="/galeria">
              <Galeria/>
            </Route>
            <Route path="/lugares">
              <Lugares />
            </Route>
            <Route path="/excursiones">
              <Excursiones/>
            </Route>
            <Route path="/cursos">
              <Cursos />
            </Route>
            <Route path="/">
              <Home />
            </Route>
          </Switch>          
        </div>
        
      </Router>
      
    );
  }
 
  export default Routers;
